import React, { useEffect } from "react";
import "./Productlist.css";
import { useNavigate, useParams } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { productActions } from "../../toolkit/actions/product_action";

const Productlist = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch();

  const seller_id = 2;

  const savemenunavi = (e) => {
    navigate("/seller/product/save");
  };

  const listmenunavi = (e) => {
    navigate("/seller/product/list");
  };

  useEffect(() => {
    console.log("+++++++++", seller_id);
    dispatch(productActions.getSellerList(seller_id));
  }, []);
  const imagePath = `/public/shopimg/44_product_img0_바밤바.png`;
  return (
    <>
      <h1 className="head">물품 리스트</h1>
      <div className="seller_body">
        <div className="seller_menu_box">
          <table>
            <tbody>
              <button className="seller_menu_box_list" onClick={listmenunavi}>
                물품 리스트
              </button>
              <button className="seller_menu_box_list" onClick={savemenunavi}>
                물품 등록
              </button>
              <button className="seller_menu_box_list">정산</button>
            </tbody>
          </table>
        </div>
        <form>
          <table>
            <tbody className="seller_list_body">
              <tr className="seller_list_body_list">
                <th>seller_id</th>
                <td>{seller_id}</td>
              </tr>
              <tr className="seller_list_body_list">
                <th></th>
                <td></td>
              </tr>
              <tr className="seller_list_body_list">
                <th></th>
                <td></td>
              </tr>
              <tr className="seller_list_body_list">
                <th></th>
                <td>
                  <img
                    src={imagePath}
                    alt="product_img0"
                    width="300"
                    height="300"
                  />
                </td>
              </tr>
            </tbody>
          </table>
        </form>
      </div>
    </>
  );
};

export default Productlist;
